var found = 0;
var loadedSuccessfully = 0;
var migratedWithValidationErrors = 0;
var processedSuccessfully = 0;


for (var l=0; l<50; l++) {
    var statisticsMigration = migrationSTC.executeEBULegacyOrderMigrationSingleRun();

    found                        += statisticsMigration[0];
    loadedSuccessfully           += statisticsMigration[1];
    migratedWithValidationErrors += statisticsMigration[2];
    processedSuccessfully        += statisticsMigration[3];


    Global.commitTransaction("ORDER");
}
var msg = "Execution Completed\n" + "Statistics:\n" +
          "  Found: " + found + "\n" +
          "  Loaded Successfully: " + loadedSuccessfully + "\n" +
          "  Migrated With Validation Errors: " + migratedWithValidationErrors + "\n" +
          "  Processed Successfully: " + processedSuccessfully;
debugPrintln("[" + common.common_currentDateAsStringDDMMYYYYHH24MISS() + "] migrateEBULegacyToBundle - " + msg);
Global.showUserMessage(msg);

var orderIdsFound = Finder.runFinder("migrationSTC.findMigratedOrderIdsInProvisioning", "select", null);
// note: the finder returns a document whose leaf name is "cwDocID" but it contains the cwOrderId!!!!

var found = 0;
var migratedWithValidationErrors = 0;
var processedSuccessfully = 0;

if(orderIdsFound != null) {
    found = orderIdsFound.length;
    for(var i=0; i<orderIdsFound.length; i++) {
        try {
            var order = Order.getOrderById(orderIdsFound[i].cwDocID);
            if(order!= null) {
                var validationErrors = order.validate(1000, true);
                if(validationErrors != null) {
                    debugPrintln("[" + common.common_currentDateAsStringDDMMYYYYHH24MISS() + "] StartProcessForMigratedBundleInProv - Order " + orderIdsFound[i].cwDocID + " has validation errors!");
                    migratedWithValidationErrors++
                }
                else {
                    debugPrintln("[" + common.common_currentDateAsStringDDMMYYYYHH24MISS() + "] StartProcessForMigratedBundleInProv - Starting OrchestrationProcess For Order " + orderIdsFound[i].cwDocID);
                    var processId = Process.startProcess ("processSTC.mainSTCOrchestrationProcess", orderIdsFound[i].cwDocID, orderIdsFound[i].cwDocID);
                    debugPrintln("[" + common.common_currentDateAsStringDDMMYYYYHH24MISS() + "] StartProcessForMigratedBundleInProv - Started OrchestrationProcess For Order " + orderIdsFound[i].cwDocID + "; processId = " + processId);
                    processedSuccessfully++;
                }
            }
            else {
                debugPrintln("[" + common.common_currentDateAsStringDDMMYYYYHH24MISS() + "] StartProcessForMigratedBundleInProv - Unable to load the order " + orderIdsFound[i].cwDocID + "!");
            }
        }
        catch(exc) {
debugPrintln("[" + common.common_currentDateAsStringDDMMYYYYHH24MISS() + "] StartProcessForMigratedBundleInProv - Order.id: " + orderIdsFound[i].cwDocID + " - Exc: " + exc.message);
        }
    }
}

var msg = "Execution Completed\n" + "Statistics:\n" +
          "  Found: " + found + "\n" +
          "  Migrated with validation errors: " + migratedWithValidationErrors + "\n" +
          "  Processed Successfully: " + processedSuccessfully;
debugPrintln("[" + common.common_currentDateAsStringDDMMYYYYHH24MISS() + "] StartProcessForMigratedBundleInProv - " + msg);
Global.showUserMessage(msg);

var inputDoc = new Document("ds_ws.search_bundleOrder");
inputDoc.isMigrated = true;

var orderListFound = Finder.runFinder("ds_ws.findAllSTCBundleOrders_Script", "select", inputDoc);

var countDeleted = 0;
if(orderListFound != null && orderListFound.length > 0) {
    var limit = (orderListFound.length > 1000 ? 1000 : orderListFound.length);

    for(var i=0; i<limit; i++) {
        var order = Order.getOrderById(orderListFound[i].id);
        order.deleteOrder();
        ds_ws.deleteAllReasonCodesInOrder(order.id);
        ds_ws.deleteAllBlockValuesInOrder(order.id);

        var orderOrchestrationList = processSTC.findRecordsInOrchTabByOrderId_ParentId(order.id);
        if(orderOrchestrationList != null && orderOrchestrationList.length > 0) {
            for(var j=0; j<orderOrchestrationList.length; j++) {
                orderOrchestrationList[j].deleteItem();
            }
        }

        countDeleted++;
    }
}

var msg = "Execution Completed\n" +
          "  Deleted: " + countDeleted;
debugPrintln("[" + common.common_currentDateAsStringDDMMYYYYHH24MISS() + "] deleteMigratedOrders - " + msg);
Global.showUserMessage(msg);

